- (void)calcBnBoxWithAddPoints {
    minBn = CGPointMake(1000, 1000);
    maxBn = CGPointMake(0, 0);
    
    int prev_x=-1, prev_y=-1;
    
    NSUInteger size = [self.points count];
    for (NSUInteger i=0; i<size; ++i) {
        struct CGPoint p;
        [[self.points objectAtIndex:i] getValue:&p];
        
        if( p.x > maxBn.x ) maxBn.x = p.x;
        if( p.y > maxBn.y ) maxBn.y = p.y;
        if( p.x < minBn.x ) minBn.x = p.x;
        if( p.y < minBn.y ) minBn.y = p.y;
        
        if (prev_x != -1 && prev_y != -1) {
            int x = p.x;
            int y = p.y;
            
            if (abs(x-prev_x) > 1 || abs(y-prev_y) > 1) {
                if (abs(x-prev_x) < 1.0e-5) {
                    int min = MIN(y, prev_y);
                    int max = MAX(y, prev_y);
                    for( int i=min+1; i<max; ++i) {
                        [self.points addObject:[NSValue valueWithCGPoint:CGPointMake(x, i)]];
                    }
                }
                else {
                    float k = (float)(prev_y-y)/(float)(prev_x-x);
                    float b = (float)(-prev_y*x + y*prev_x)/(float)(prev_x-x);
                    float k_abs = fabs(k);
                    if (k_abs < 1) {
                        int min = MIN(x, prev_x);
                        int max = MAX(x, prev_x);
                        for( int i=min+1; i<max; ++i) {
                            int tmpY = k*(float)i + b;
                            [self.points addObject:[NSValue valueWithCGPoint:CGPointMake(i, tmpY)]];
                        }
                    }
                    else {
                        int min = MIN(y, prev_y);
                        int max = MAX(y, prev_y);
                        for( int i=min+1; i<max; ++i) {
                            int tmpX = (float)(i)/k - (float)(b)/k;
                            [self.points addObject:[NSValue valueWithCGPoint:CGPointMake(tmpX, i)]];
                        }
                    }
                }
            }
        }
        prev_x = p.x;
        prev_y = p.y;
    }
    
    if( fabs(maxBn.x - minBn.x) < 1.0e-5 )
        maxBn.x += 1;
    
    if( fabs(maxBn.y - minBn.y) < 1.0e-5 )
        maxBn.y += 1;

    maxBn.x -= minBn.x;
    maxBn.y -= minBn.y;
    size = [self.points count];
    for (NSUInteger i=0; i<size; ++i) {
        struct CGPoint p;
        [[self.points objectAtIndex:i] getValue:&p];
        p.x -= minBn.x;
        p.y -= minBn.y;
        [self.points replaceObjectAtIndex:i withObject:[NSValue valueWithCGPoint:p]];
    }
    
    for (NSUInteger i=0; i<size; ++i) {
        struct CGPoint p;
        [[self.points objectAtIndex:i] getValue:&p];
    }
}


- (float*)createSquare:(int)gridSize {
    float LINE = 1.0;
    float BACKGROUND = 0.0;
    
    int dx = maxBn.x;
    int dy = maxBn.y;
    
    float *sss = 0;
    int sssSize = 0;
    float *grid = malloc(sizeof(float)*gridSize*gridSize);
    
    for (int i=0; i<gridSize*gridSize; ++i) grid[i] = BACKGROUND;
    
    if (dx < dy) {
        sssSize = dy + 1;
        sss = malloc(sizeof(float) * sssSize * sssSize );
        for (int i=0; i<sssSize; ++i)
            for (int j=0; j<sssSize; ++j)
                sss[i*sssSize+j] = BACKGROUND;
        
        int leftAdd = (dy-dx-1)/2;
        
        NSUInteger size = [self.points count];
        for (NSUInteger i=0; i<size; ++i) {
            struct CGPoint p;
            [[self.points objectAtIndex:i] getValue:&p];
            
            int ind = leftAdd + p.x + 1+ p.y*sssSize;
            
            sss[ind] = LINE;
            
            int i = ind / sssSize;
            int j = ind % sssSize;
            int mapI = i*gridSize/sssSize;
            int mapJ = j*gridSize/sssSize;
            
            
            grid[mapI*gridSize + mapJ] = LINE;
        }
    }
    else {
        sssSize = dx + 1;
        sss = malloc(sizeof(float) * sssSize * sssSize );
        for (int i=0; i<sssSize; ++i)
            for (int j=0; j<sssSize; ++j)
                sss[i*sssSize+j] = BACKGROUND;
        
        int botAdd = (dx-dy-1)/2;
        NSUInteger size = [self.points count];
        for (NSUInteger i=0; i<size; ++i) {
            struct CGPoint p;
            [[self.points objectAtIndex:i] getValue:&p];
            
            int ind = botAdd*sssSize + p.x+ p.y*sssSize;
            
            sss[ind] = LINE;
            
            int i = ind / sssSize;
            int j = ind % sssSize;
            int mapI = i*gridSize/sssSize;
            int mapJ = j*gridSize/sssSize;
            
            
            grid[mapI*gridSize + mapJ] = LINE;
        }
    }
    
    free(sss);

    return grid;
}


